import React, { useContext } from "react";
import { contextData } from "./Context";
import { NavLink, Link } from "react-router-dom";
// import { Home } from './Home';
import "./blogStyles.css"; //ths is serious

export const Header = () => {
  const [article] = useContext(contextData);

  return (
    <div className="stkhead">
      <h1 className="headsiren">
        <h2>The</h2>Siren
      </h1>
      <button
        class="navbar-toggler"
        type="button"
        data-bs-toggle="collapse"
        data-bs-target="#navbarNav"
        aria-controls="navbarNav"
        aria-expanded="false"
        aria-label="Toggle navigation"
      >
        <span class="navbar-toggler-icon"></span>
      </button>
      <h2 className="titlelink">
        <NavLink
          className="nlink"
          style={({ isActive }) => {
            return { color: isActive ? "gray" : "" };
          }}
          to="./home"
        >
          {" "}
          Home
        </NavLink>
        <NavLink
          className="nlink"
          style={({ isActive }) => {
            return { color: isActive ? "gray" : "" };
          }}
          to={`./${bollywood}`}
        >
          {" "}
          Bollywood
        </NavLink>
        <NavLink
          className="nlink"
          style={({ isActive }) => {
            return { color: isActive ? "gray" : "" };
          }}
          to="./technology"
        >
          {" "}
          Technology
        </NavLink>
        <NavLink
          className="nlink"
          style={({ isActive }) => {
            return { color: isActive ? "gray" : "" };
          }}
          to="./hollywood"
        >
          {" "}
          Hollywood
        </NavLink>
        <NavLink
          className="nlink"
          style={({ isActive }) => {
            return { color: isActive ? "gray" : "" };
          }}
          to="./fitness"
        >
          {" "}
          Fitness
        </NavLink>
        <NavLink
          className="nlink"
          style={({ isActive }) => {
            return { color: isActive ? "gray" : "" };
          }}
          to="./food"
        >
          {" "}
          Food
        </NavLink>
      </h2>
      <hr className="hrstl" />
    </div>
  );
};
